import './App.css';
import 'bootstrap/dist/css/bootstrap.min.css';
import React, { useState } from 'react';

import { Component } from 'react';
 
function ListaUsers(usuarios){

  const copiaUsuarios = [...usuarios]
  return (
    <div>
      <h3></h3>
      <ul>
        {copiaUsuarios.map(u=>{
            <li>{u}</li>
        })}
      </ul>
    </div>
  );
}


class App extends Component {
  constructor(props){
    super(props)
    this.state = {
      isOpen:false,
    }
  }

  render() {
    const [usuarios, setUsuarios] = useState([{nombre:"Victor", telefono:69736, email:"victor@mail.com"}])

    return (
      <div className="App">
        App

        <ListaUsers 
        usuarios={usuarios}
        />
      </div>
    );
  }
}

export default App;
